window.onload = function () {
    img_out = document.createElement("img");
    img_in = document.createElement("img");
    img_main = document.createElement("img");
    img_out.id = "page_up_out";
    img_in.id = "page_up_in";
    img_out.className = img_in.className = img_main.className = "page_up";
    img_out.src = "data:image/png;base64,";
    img_in.src = "data:image/png;base64,";
    img_main.src = "data:image/png;base64,";
    img_out.width = img_in.width = img_main.width = "88";
    img_out.height = img_in.height = img_main.height = "88";
    img_main.onmouseover = back_running;
    img_main.onmouseout = back_paused;
    img_main.onclick = back_to_top;
    document.body.appendChild(img_out);
    document.body.appendChild(img_in);
    document.body.appendChild(img_main);
};

function back_running() {
    img_out.style.animationPlayState = "running";
    img_in.style.animationPlayState = "running";
}

function back_paused() {
    img_out.style.animationPlayState = "paused";
    img_in.style.animationPlayState = "paused";
}

function back_to_top() {
    document.body.scrollTop = 0;
}
